import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';
import Login from './pages/Login';
import Teste from './pages/Teste';

function App() {
  return (
    <div>
      <Router>
        <Route path="/" component={ Login } />
        <Route path="/teste" component={ Teste } />
      </Router>
    </div>
  );
}

export default App;
